import './UserForm.css';

import Card from '../Card'
import '../Card.css'

export default function UserForm() {

    return (
        <Card>
            <div>
                <label>User name</label>
                <input></input>
            </div>
            
            <div>
                <label>Age</label>
                <input></input>
            </div>
        </Card>
    )

};
